    super(props);
  }

  componentDidMount() {
    const options = {
      stringsElement: '#SkiCollection',
      typeSpeed: 50,
      backSpeed: 25,
      backDelay: 1000,
      loop: true,
      showCursor: false
    }

    this.typed = new Typed(this.el, options);
  }

  componentWillUnmount() {
    this.typed.destroy();
  }

  render() {
    return (
      <div className="SkillPage">
        <section className="Skill-sect">
	  <div className="Skill-head">
            <div className="Skill-coll" id="SkiCollection">
	      <blockquote>"Skill is part of a man."</blockquote>
	      <blockquote>"Man choose his pathway."</blockquote>
	      <blockquote>"The path honed a man abilities."</blockquote>
	      <blockquote>"As man set the limit, the skill will rise."</blockquote>
	    </div>
	    <div className="Experience-typed" ref={(el)=>{this.el=el;}}>
	    </div>
	  </div>
        </section>
	{ expData.map((data) =>
	  <section className={data.expId % 2 ? "Experience-sect invert" : "Experience-sect"}>
	    <div className="Experience-cont">
	      <div className="Experience-det">
	        <div className="Experience-left">
	          {data.expId % 2 ? <ExpPageInfo data={data} /> : <img src={data.img} />}
	        </div>
	        <div className="Experience-right">
		  {data.expId % 2 ? <img src={data.img} /> : <ExpPageInfo data={data} />}
	        </div>
	      </div>
	      <div className="Experience-stat">{data.stat}</div>
	    </div>
	  </section>
        )}
      </div>
    );
  }
}

export default ExperiencePage;
